import "./Speakers.css";

const Speakers = () => {
  return (
    <section className="speakers">
      <div className="speakers__title-wrap">
        <p className="speakers__title">speakers</p>
      </div>

      <div className="products">
        <ProductsCard />
        <ProductsCard />
        <ProductsCard />
        <ProductsCard />
      </div>

      <div className="categories">
        <CategoryCards />
      </div>

      <div className="about">
        <About />
      </div>
    </section>
  );
};
export default Speakers;
